attributes.template:
#cloud-config

write_files:
    -   path: /etc/replicated.rli
        owner: root:root
        permissions: "0444"
        encoding: b64
        content: ${license_b64}

    -   path: /etc/replicated-ptfe.conf
        owner: root:root
        permissions: "0644"
        content: |
          {
            "installation_type": {
                "value": "production"
            },
            "hostname": {
                "value": "${HOSTNAME}"
            },
            "capacity_concurrency": {
                "value": "10"
            },
            "capacity_memory": {
                "value": "512"
            },
            "production_type": {
                "value": "external"
            },
            "pg_user": {
                "value": "${PG_USER}"
            },
            "pg_password": {
                "value": "${PG_PASSWORD}"
            },
            "pg_netloc": {
                "value": "${PG_HOSTNAME}:${PG_PORT}"
            },
            "pg_dbname": {
                "value": "${DB_NAME}"
            },
            "placement": {
                "value": "placement_s3"
            },
            "aws_instance_profile": {
                "value": "1"
            },
            "s3_bucket": {
                "value": "${S3_BUCKET}"
            },
            "s3_region": {
                "value": "${S3_REGION}"
            },
            "enc_password": {
                "value": "${PG_PASSWORD}"
            }
          }

    ## https://help.replicated.com/docs/kb/developer-resources/automate-install/
    -   path: /etc/replicated.conf
        owner: root:root
        permissions: "0644"
        content: |
          {
            "DaemonAuthenticationType": "password",
            "DaemonAuthenticationPassword": "${ADMIN_PASSWORD}",
            "TlsBootstrapType": "self-signed",
            "LogLevel": "debug",
            "ImportSettingsFrom": "/etc/replicated-ptfe.conf",
            "LicenseFileLocation": "/etc/replicated.rli",
            "BypassPreflightChecks": true
          }

    -   path: /etc/replicated.sql
        owner: root:root
        permissions: "0644"
        content: |
          CREATE SCHEMA rails;
          CREATE SCHEMA vault;
          CREATE SCHEMA registry;
          \q

    -   path: /etc/replicated.sh
        owner: root:root
        permissions: "0644"
        content: |
          export PGPASSWORD="${PG_PASSWORD}"
          export PG_PORT="${PG_PORT}"
          export PG_HOSTNAME="${PG_HOSTNAME}"
          export PG_USER="${PG_USER}"
          psql -p ${PG_PORT} -h ${PG_HOSTNAME} -U ${PG_USER} -w < /etc/replicated.sql

    -   path: /var/lib/cloud/scripts/per-once/install-ptfe.sh
        owner: root:root
        permissions: "0555"
        encoding: b64
        content: ${install_ptfe_sh}

packages:
    - jq
    - postgresql
